import{_ as t,c as e,o as d,a2 as a}from"./chunks/framework.CSd21wiM.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"usage/limits.md","filePath":"usage/limits.md"}'),n={name:"usage/limits.md"},r=a('<p>We have several limits in place to ensure that our service is available to everyone. Some limits depend on the plan you&#39;re subscribed to, while others are the same for everyone.</p><p>You can contact us if you need to increase some limits.</p><h2 id="accounts" tabindex="-1">Accounts <a class="header-anchor" href="#accounts" aria-label="Permalink to &quot;Accounts&quot;">​</a></h2><p>Each account can create at most 3 Organizations.</p><h2 id="organizations" tabindex="-1">Organizations <a class="header-anchor" href="#organizations" aria-label="Permalink to &quot;Organizations&quot;">​</a></h2><p>An Organization name can be at least 3 and up to 64 characters long. An Organization description can be at most 256 characters long. An Organization can have at most 20 Functions.</p><table><thead><tr><th></th><th>Personal</th><th>Pro</th><th>Enterprise</th></tr></thead><tbody><tr><td>Organization members</td><td>1</td><td>10</td><td>Unlimited</td></tr><tr><td>Functions</td><td>10</td><td>50</td><td>Unlimited</td></tr></tbody></table><h2 id="functions" tabindex="-1">Functions <a class="header-anchor" href="#functions" aria-label="Permalink to &quot;Functions&quot;">​</a></h2><p>Each Function name must be unique. The name must be at least 3 and up to 64 characters long and can only contain letters, numbers, and dashes. The name cannot start or end with a dash.</p><p>Below are the limits for each plan:</p><table><thead><tr><th></th><th>Personal</th><th>Pro</th><th>Enterprise</th></tr></thead><tbody><tr><td>Free requests/month</td><td>3,000,000</td><td>5,000,000</td><td>Custom</td></tr><tr><td>Code size</td><td>10MB</td><td>10MB</td><td>Custom</td></tr><tr><td>Assets</td><td>100</td><td>1000</td><td>Custom</td></tr><tr><td>Assets size</td><td>10MB</td><td>10MB</td><td>Custom</td></tr><tr><td>Memory</td><td>128MB</td><td>128MB</td><td>Up to 1GB</td></tr><tr><td>Maximum request duration</td><td>5s</td><td>30s</td><td>Custom</td></tr><tr><td>Custom domains</td><td>10</td><td>10</td><td>Custom</td></tr><tr><td>Environment variables</td><td>100</td><td>100</td><td>Custom</td></tr><tr><td>Env. var. key length</td><td>64 characters</td><td>64 characters</td><td>Custom</td></tr><tr><td>Env. var. value size</td><td>5KB</td><td>5KB</td><td>Custom</td></tr><tr><td><code>fetch()</code> calls/request</td><td>20</td><td>20</td><td>Custom</td></tr><tr><td><code>fetch()</code> redirections</td><td>5</td><td>5</td><td>Custom</td></tr></tbody></table><p>Additionally, code generation from strings is disabled by default. In the future, you&#39;ll be able to enable it on a per-Function basis. That means running <code>eval</code> or <code>new Function</code> will throw an error.</p>',12),o=[r];function s(i,c,h,l,u,m){return d(),e("div",null,o)}const _=t(n,[["render",s]]);export{b as __pageData,_ as default};
